import React from 'react'
import Card  from 'react-bootstrap/Card'

const CategoryCard = (props)=>{
    return(
        <Card>
            <Card.Img variant="top" src={props.img} />
            <Card.Body>
                <Card.Text className='text-center'>
                    <h4>{props.category}</h4>
                </Card.Text>
            </Card.Body>
        </Card>
    )
}

export default CategoryCard;
